      <div className="settingsBlock">
        <form className="settings">
          <input type="text" placeholder="Firstname"/>
          <input type="text" placeholder="Secondname"/>
          <input type="text" placeholder="Fathername"/>
          <input type="text" placeholder="City"/>
          <div Nameclass='gender'>
            <label>Male: <input name='radio' type="radio" value='true'/>&#160;</label>
            <label>Female: <input name='radio' type="radio" value='false'/>&#160;</label>
          </div>
          <div>
            <select Nameclass="selectDate">
              <option>1</option>
              <option>len'</option>
            </select>
            <select Nameclass="selectDate">
              <option>Jenuary</option>
              <option>len'</option>
            </select>
            <select Nameclass="selectDate">
              <option>2000</option>
              <option>1990</option>
            </select>
          </div>
          <input type="submit" value="Submit"/>
        </form>
      </div>
    )
  }
}

